        if(subscribed)
            resolve("user subscribed")
        else
            reject("user not subscribed")
    })

    const start=()=>

    subscribe.then((result)=>{
        console.log(result)
    }).catch((err)=>console.log(err))


    return (
        <div className='text-center'>
            PromisesFunc
            <button className='btn btn-primary' onClick={()=>subscribe()}>Subscribe</button>
        </div>
    )
}

